/// data : [{"id":221,"title":"$ASII ","description":"• Serangkaian sentimen negatif telah terefleksi pada harga saham\n• Dengan PE 6,8x, valuasi saat ini selevel periode pandemi Covid\n• Risiko earnings miss relatif terbatas karena ekspektasi kinerja yang achievable","volume":26,"date":"2023-12-31T17:00:00Z","thumbnail_url":"https://academy-content.stockbit.com/uploaded-images/081d8dbd-d6bf-47b1-8033-67e93349b777.jpg","status":"CONTENT_STATUS_PUBLISH","files":[],"created_at":"2023-12-04T06:10:46.759674Z","updated_at":"2023-12-04T10:24:20.724670Z","date_display":"December 2023","category":"UNBOXING_CATEGORY_EMITTEN","compressed_thumbnail_url":"https://academy-content.stockbit.com/unboxing/d7ec259c-9870-4a65-83a7-6cb72959f240.jpg","description_masked":"","masks":[],"image_url_full":"","image_url_wide":""},{"id":209,"title":"$ARCI - Archi Indonesia","description":"- Kami mengestimasikan laba bersih ARCI naik lebih dari 3x lipat pada FY24.\n\n- Kenaikan laba didorong oleh proyeksi kenaikan harga emas (+3,2% YoY) dan pemulihan pit Araren (estimasi ~40–50% dari total produksi)\n\n- Valuasi P/E 2024F ARCI di 6,94x, lebih rendah dari rata-rata peers global (15,58x)","volume":25,"date":"2023-11-30T17:00:00Z","thumbnail_url":"https://academy-content.stockbit.com/uploaded-images/021eb822-8e94-4832-b504-b3896428b7d4.jpg","status":"CONTENT_STATUS_PUBLISH","files":[],"created_at":"2023-11-23T02:58:20.308562Z","updated_at":"2023-12-04T06:06:15.072619Z","date_display":"November 2023","category":"UNBOXING_CATEGORY_EMITTEN","compressed_thumbnail_url":"https://academy-content.stockbit.com/unboxing/980f8c3f-bf81-4a57-8cd3-08b9dbdd93c4.jpg","description_masked":"","masks":[],"image_url_full":"","image_url_wide":""},{"id":208,"title":"$HOKI - Buyung Poetra Sembada","description":"Harga saham Buyung Poetra Sembada ($HOKI) telah melonjak +65% sejak akhir Desember dari level terendahnya di kisaran Rp75/saham, seiring sentimen positif atas pemberitaan harga beras yang sedang mengalami kenaikan. Meski demikian, kami menilai bahwa market terlalu optimis dengan prospek harga beras dan implikasinya terhadap profitabilitas HOKI, karena model bisnis pengolahan dan perdagangan beras sebenarnya kurang diuntungkan dari tren kenaikan harga beras. ","volume":24,"date":"2023-11-30T17:00:00Z","thumbnail_url":"https://academy-content.stockbit.com/uploaded-images/929b8441-ef9e-45cc-82b2-2594ea05aeb4.jpg","status":"CONTENT_STATUS_PUBLISH","files":[],"created_at":"2023-11-02T07:57:04.259112Z","updated_at":"2023-11-02T08:54:44.723805Z","date_display":"November 2023","category":"UNBOXING_CATEGORY_EMITTEN","compressed_thumbnail_url":"https://academy-content.stockbit.com/unboxing/10eeb285-5d1f-47c1-b444-090fdb48b1c3.jpg","description_masked":"","masks":[],"image_url_full":"","image_url_wide":""},{"id":200,"title":"WINS - Wintermar Offshore Marine","description":"Lonjakan permintaan minyak mentah akibat pemulihan ekonomi pasca-pandemi tidak diimbangi dengan supply yang mencukupi. Kondisi ini berpotensi mendorong kinerja Wintermar Offshore Marine ($WINS). Sebagai perusahaan offshore supply vessel (OSV), WINS berpeluang meningkatkan utilisasi dan tarif sewa harian kapalnya seiring peningkatan aktivitas eksplorasi minyak. Di sisi lain, ketidakpastian ekonomi dan peralihan ke energi terbarukan dapat kembali menekan permintaan dan eksplorasi minyak mentah. Lantas, bagaimana prospek WINS ke depannya? Simak analisis selengkapnya di Unboxing Saham WINS berikut ini!","volume":16,"date":"2022-12-31T17:00:00Z","thumbnail_url":"https://academy-content.stockbit.com/uploaded-images/bafa5bb1-2982-4b58-8350-213dd4166c45.jpg","status":"CONTENT_STATUS_PUBLISH","files":[],"created_at":"2022-12-15T03:22:59.647892Z","updated_at":"2023-01-04T02:37:45.511878Z","date_display":"December 2022","category":"UNBOXING_CATEGORY_EMITTEN","compressed_thumbnail_url":"https://academy-content.stockbit.com/unboxing/b8438b6b-a075-4d26-9915-bb14a0956450.jpg","description_masked":"","masks":[],"image_url_full":"","image_url_wide":""},{"id":166,"title":"$PSSI - Pelita Samudera Shipping","description":"Lonjakan permintaan batu bara sejak 2021 mendorong kinerja dan utilisasi armada Pelita Samudera Shipping ($PSSI). \n\nMargin labanya meningkat, didorong oleh segmen kapal motor untuk rute internasional yang terdampak kenaikan harga acuan Baltic Dry Index.\n\n$PSSI juga berhasil menurunkan gearing ratio dalam 3 tahun terakhir dan mencatatkan net cash pada 1H22. Namun, di tengah ketidakpastian ekonomi pada tahun depan, $PSSI berisiko mengalami penurunan pengiriman batu bara.\n\nLantas, bagaimana prospek $PSSI ke depannya? Simak analisis lengkapnya di Unboxing Saham PSSI dari Stockbit Academy!","volume":14,"date":"2022-10-31T17:00:00Z","thumbnail_url":"https://academy-content.stockbit.com/uploaded-images/57496a59-e514-4c2e-8375-143109c13be6.jpg","status":"CONTENT_STATUS_PUBLISH","files":[],"created_at":"2022-10-13T02:30:34.486658Z","updated_at":"2023-01-04T02:37:13.439554Z","date_display":"October 2022","category":"UNBOXING_CATEGORY_EMITTEN","compressed_thumbnail_url":"https://academy-content.stockbit.com/unboxing/fe10a107-cc78-473d-aac0-aeb397db9529.jpg","description_masked":"","masks":[],"image_url_full":"","image_url_wide":""},{"id":135,"title":"$POWR - Cikarang Listrindo","description":"Cikarang Listrindo ($POWR) merupakan salah satu emiten dengan dividend yield tertinggi di BEI dengan rata-rata yield 9% selama 2017-2021. Perusahaan listrik swasta ini juga mampu menjaga operating profit margin di tengah lonjakan harga komoditas dan mencatat kenaikan demand akibat pemulihan ekonomi pasca-pandemi.\n\nMeski demikian, pendapatan POWR berisiko menurun jika kontrak dengan PLN habis. Di sisi lain, penurunan permintaan dari PLN diyakini tidak akan menjadi masalah bagi POWR, karena ketersediaan stok listrik bisa dialihkan kepada pelanggan baru seperti data center. POWR juga tengah mempersiapkan stasiun pengisian untuk menyambut perkembangan kendaraan listrik di Indonesia.\n\nBagaimana prospek POWR di masa depan? Apakah POWR dapat memaksimalkan peluang menjadi pemasok energi bagi data center dan stasiun pengisian kendaraan listrik? Simak selengkapnya di Unboxing Saham POWR!","volume":13,"date":"2022-09-30T17:00:00Z","thumbnail_url":"https://academy-content.stockbit.com/uploaded-images/88e4e32c-abd9-4d6f-9ef2-bded256331bf.jpg","status":"CONTENT_STATUS_PUBLISH","files":[],"created_at":"2022-09-15T11:50:41.676972Z","updated_at":"2023-01-04T02:36:26.800143Z","date_display":"September 2022","category":"UNBOXING_CATEGORY_EMITTEN","compressed_thumbnail_url":"https://academy-content.stockbit.com/unboxing/cd223a35-9984-4743-8502-366861506a96.jpg","description_masked":"","masks":[],"image_url_full":"","image_url_wide":""},{"id":133,"title":"$ASSA - Adi Sarana Armada","description":"Harga saham $ASSA sudah turun lebih dari 50% dari level tertingginya. Naiknya sentimen suku bunga memang dapat berdampak negatif karena utang floating rate mencapai Rp3,1 T, sehingga bisa meningkatkan beban bunga.\n\nNamun, ASSA memiliki bisnis yang stable dan profitable seperti ASSA Rent (sewa mobil) dan JBA (lelang mobil bekas). Selain itu, mesin pertumbuhan pendapatan ASSA, Anteraja, juga sudah mencatatkan keuntungan pada 4Q21 dan 1Q22.\n\nApakah dengan valuasi yang menurun ini menjadi kesempatan menarik bagi investor? Simak analisis lengkapnya di Unboxing Saham ASSA","volume":11,"date":"2022-09-30T17:00:00Z","thumbnail_url":"https://academy-content.stockbit.com/uploaded-images/ae78ba4d-fa43-4e06-a78c-9cebc07ad21b.jpg","status":"CONTENT_STATUS_PUBLISH","files":[],"created_at":"2022-09-06T11:28:53.523702Z","updated_at":"2023-01-04T02:36:59.764607Z","date_display":"September 2022","category":"UNBOXING_CATEGORY_EMITTEN","compressed_thumbnail_url":"https://academy-content.stockbit.com/unboxing/57e3e079-3685-4504-ba68-7b99bbf0db0b.jpg","description_masked":"","masks":[],"image_url_full":"","image_url_wide":""},{"id":103,"title":"$BIRD - Blue Bird","description":"Relaksasi pembatasan Covid-19 mendorong pemulihan kinerja bisnis Blue Bird ($BIRD). Layanannya juga semakin kompetitif sebagai subtitusi ride-hailing yang kemungkinan mengurangi diskon bagi pelanggan demi mengejar profitabilitas. Lantas, bagaimana performa dan tren yang mempengaruhi Blue Bird akhir-akhir ini? Simak selengkapnya di Unboxing Saham BIRD!","volume":9,"date":"2022-06-30T17:00:00Z","thumbnail_url":"https://academy-content.stockbit.com/uploaded-images/bfba1a9a-8022-438f-ae35-569c9e39ef91.jpg","status":"CONTENT_STATUS_PUBLISH","files":[],"created_at":"2022-06-30T06:14:43.855443Z","updated_at":"2023-01-04T02:34:03.152202Z","date_display":"June 2022","category":"UNBOXING_CATEGORY_EMITTEN","compressed_thumbnail_url":"https://academy-content.stockbit.com/unboxing/f8ff44ed-9e31-4ccc-8bcd-96287aa186c9.jpg","description_masked":"","masks":[],"image_url_full":"","image_url_wide":""},{"id":102,"title":"$MARK - Mark Dynamics Indonesia ","description":"Sebagai produsen cetakan sarung tangan terbesar di dunia, MARK menguasai 40% market share global. Kapasitas produksinya saat ini telah naik lebih dari 2x lipat secara tahunan dan tumbuh dengan CAGR +36,6% sejak IPO pada 2017. Performa apiknya juga terefleksi pada pertumbuhan pendapatan, laba bersih, dan juga total aset. Yuk, kenalan lebih lanjut sama $MARK!","volume":8,"date":"2022-06-30T17:00:00Z","thumbnail_url":"https://academy-content.stockbit.com/uploaded-images/4904a3c3-2c31-4a1d-9c55-49d5c7945e35.jpg","status":"CONTENT_STATUS_PUBLISH","files":[],"created_at":"2022-06-30T04:42:44.203592Z","updated_at":"2023-01-04T02:34:18.865243Z","date_display":"June 2022","category":"UNBOXING_CATEGORY_EMITTEN","compressed_thumbnail_url":"https://academy-content.stockbit.com/unboxing/497adb0e-25ce-4e4e-8cf4-5b12abce7b98.jpg","description_masked":"","masks":[],"image_url_full":"","image_url_wide":""}]
